import React from 'react';
import { Device } from 'Domain/Device';

interface Props {
    devices: Device[]
}

function DeviceList(props: Props): JSX.Element {
console.log(props.devices);
let devices = Object.values(props.devices);
    return (
        <ul>
            {devices.map(device => (
                <li key={device.name}>{device.brand}>{device.name}: {device.brand}</li>
            ))}
        </ul>
    )
}

export default DeviceList;
